$(function(){"use strict";$('[data-type="review-gallery"], [data-type="clients-gallery"]').flickity({pageDots:!1,prevNextButtons:!1,wrapAround:!0}),$(".block.is-reviews, .block.is-clients").on("click",'[data-type="gallery-prev-handler"], [data-type="gallery-next-handler"]',function(e){e.preventDefault();var t=$(this).closest(".block").find(".flickity-enabled").data("flickity");switch($(this).data("type")){case"gallery-prev-handler":t.previous(!0);break;case"gallery-next-handler":t.next(!0)}})});